function calculateTechnicalDebt(value) {
var factor, suffix;
var hour = 60;
var day = hour \* 8.25;

var year = day \* 230;

```
    if (!value) return '-';
    if (value < day) {
        // hours
        factor = hour;
        suffix = 'h';
    } else if (value < year) {
        // days
        factor = day;
        suffix = 'd';
    } else {
        // years
        factor = year;
        suffix = 'y';
    }
    return Math.floor(value/factor) + suffix;
}
```

